import React, { Component } from 'react';
import { AppBar, Toolbar, Button } from '@material-ui/core'

class Dashboard extends Component {

	render () {
		return (
			<div>
				<AppBar position="static">
					<Toolbar>
					<Button> Test </Button>
					</Toolbar>
				</AppBar>
			</div>
			)
	}
}

export default Dashboard
